import React from 'react'
import { HeaderWrapper, Logo, NavBar, NavItem,NavSearch,NavRight,Button } from './style'

class Header extends React.Component {
    render() {
        return (
            <HeaderWrapper>
                <Logo></Logo>

                <NavRight>
                    <Button>注册</Button>
                    <Button>写文章</Button>
                </NavRight>
            </HeaderWrapper>
        )
    }
}

export default Header;
